import React, {useState} from 'react'
import {Bar} from 'react-chartjs-2'
// import { Link } from "react-router-dom";




class ClickCountButton extends React.Component {
    state = {
        count : 0
    };

    onClick() {
        this.setState(state => ({
            count: state.count + 1
        }));
    }

    render() {
        return (
            <div className={`button`}>
             <button value="/default_data_set" onClick={this.onClick.bind(this)}>Big Button {this.state.count}</button>
         </div>
        )
    }
}


